import{_ as t,c as o,ae as i,o as n}from"./chunks/framework.B0IePAYl.js";const g=JSON.parse('{"title":"Troubleshooting","description":"Common issues and solutions for MovingBox","frontmatter":{"title":"Troubleshooting","description":"Common issues and solutions for MovingBox"},"headers":[],"relativePath":"03-support/troubleshooting.md","filePath":"03-support/troubleshooting.md"}'),a={name:"03-support/troubleshooting.md"};function r(s,e,l,c,u,h){return n(),o("div",null,[...e[0]||(e[0]=[i('<h1 id="common-issues" tabindex="-1">Common Issues <a class="header-anchor" href="#common-issues" aria-label="Permalink to &quot;Common Issues&quot;">​</a></h1><p>This page addresses the most frequently encountered issues with the MovingBox app and provides straightforward solutions.</p><h2 id="app-performance" tabindex="-1">App Performance <a class="header-anchor" href="#app-performance" aria-label="Permalink to &quot;App Performance&quot;">​</a></h2><h3 id="app-unable-to-take-photos" tabindex="-1">App Unable to Take Photos <a class="header-anchor" href="#app-unable-to-take-photos" aria-label="Permalink to &quot;App Unable to Take Photos&quot;">​</a></h3><p><strong>Solutions:</strong></p><ol><li>Check camera permissions in iOS Settings &gt; MovingBox</li><li>Restart your device</li><li>Ensure you have sufficient storage space</li><li>Try using the &quot;Choose from Library&quot; option instead</li></ol><h2 id="item-recognition" tabindex="-1">Item Recognition <a class="header-anchor" href="#item-recognition" aria-label="Permalink to &quot;Item Recognition&quot;">​</a></h2><h3 id="ai-not-recognizing-items-correctly" tabindex="-1">AI Not Recognizing Items Correctly <a class="header-anchor" href="#ai-not-recognizing-items-correctly" aria-label="Permalink to &quot;AI Not Recognizing Items Correctly&quot;">​</a></h3><p><strong>Try these tips:</strong></p><ol><li>Ensure good lighting when taking photos</li><li>Center the item in the frame with minimal background clutter</li><li>Try manual entry if the AI struggles with unusual items</li></ol><h3 id="recognition-taking-too-long" tabindex="-1">Recognition Taking Too Long <a class="header-anchor" href="#recognition-taking-too-long" aria-label="Permalink to &quot;Recognition Taking Too Long&quot;">​</a></h3><p><strong>Solutions:</strong></p><ol><li>Check your internet connection (AI processing requires internet)</li><li>Try switching between Wi-Fi and cellular data</li><li>Cancel and retry if processing exceeds 30 seconds</li><li>Use manual entry temporarily if issues persist</li></ol><h2 id="data-management" tabindex="-1">Data Management <a class="header-anchor" href="#data-management" aria-label="Permalink to &quot;Data Management&quot;">​</a></h2><h3 id="items-disappeared-from-inventory" tabindex="-1">Items Disappeared from Inventory <a class="header-anchor" href="#items-disappeared-from-inventory" aria-label="Permalink to &quot;Items Disappeared from Inventory&quot;">​</a></h3><p><strong>Possible solutions:</strong></p><ol><li>Check your filters - you may have active filters hiding items</li><li>Try the search function to locate specific items</li></ol><h2 id="account-subscription" tabindex="-1">Account &amp; Subscription <a class="header-anchor" href="#account-subscription" aria-label="Permalink to &quot;Account &amp; Subscription&quot;">​</a></h2><h3 id="subscription-not-activating" tabindex="-1">Subscription Not Activating <a class="header-anchor" href="#subscription-not-activating" aria-label="Permalink to &quot;Subscription Not Activating&quot;">​</a></h3><p><strong>Solutions:</strong></p><ol><li>Verify your purchase in Settings &gt; Subscriptions</li><li>Check that Apple payments are working on your account</li><li>Restore purchases in Settings &gt; Subscription Settings &gt; Restore</li></ol><h2 id="connectivity-issues" tabindex="-1">Connectivity Issues <a class="header-anchor" href="#connectivity-issues" aria-label="Permalink to &quot;Connectivity Issues&quot;">​</a></h2><h3 id="app-won-t-connect-to-internet" tabindex="-1">App Won&#39;t Connect to Internet <a class="header-anchor" href="#app-won-t-connect-to-internet" aria-label="Permalink to &quot;App Won&#39;t Connect to Internet&quot;">​</a></h3><p><strong>Troubleshooting:</strong></p><ol><li>Check your device&#39;s internet connection</li><li>Try switching between Wi-Fi and cellular data</li><li>Toggle Airplane mode on and off</li><li>Restart your router if using Wi-Fi</li></ol>',25)])])}const d=t(a,[["render",r]]);export{g as __pageData,d as default};
